import React from "react";
import "./styles.css";

export const EditorNameField = (props) => {
const handleChangeComplete = (text) => {
    props.action(text.target.value,"EditorName")
}
    return (
        <div style={{display: 'flex', flexDirection: 'column',marginTop:'0'}} >
        <div style={{display: 'flex', flexDirection: 'row',marginTop:'0'}} >
        <h4 style={{marginTop:'0',marginBottom:'0',marginRight:'8.5%'}}> Name:</h4>
            <input style={{display: 'flex',marginTop:'.5%',marginBottom:'0'}}
              name="fname"
              type="text"
              value={props.value}
              onChange={handleChangeComplete}
            />
        </div>
        <div style={{display: 'flex', flexDirection: 'row',marginTop:'0'}} >
        <h4 style={{marginTop:'0',marginBottom:'0'}}> Username:</h4>
            <input style={{display: 'flex',marginTop:'.5%',marginBottom:'0'}}
              name="fname"
              type="text"
              value={props.value}
              onChange={handleChangeComplete}
            />
        </div>
        </div>
    );
}
